import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './Results.css';

const Results = () => {
    const [prediction, setPrediction] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        const storedPrediction = localStorage.getItem("results");
        if (storedPrediction) {
            setPrediction(JSON.parse(storedPrediction));
        } else {
            navigate("/questionnaire"); // Redirect if no prediction found
        }
    }, [navigate]);

    if (!prediction) {
        return <p>Loading results...</p>;
    }

    const getFinalSuggestion = () => {
        const { stressScore, anxietyScore, depressionScore } = prediction;

        const highCount = [stressScore, anxietyScore, depressionScore].filter(level => level === "High").length;
        const moderateCount = [stressScore, anxietyScore, depressionScore].filter(level => level === "Moderate").length;

        if (highCount >= 2) {
            return "âš ï¸ High levels of mental health concerns detected. Please consider consulting a professional.";
        } else if (moderateCount >= 2) {
            return "ðŸ”” Moderate concerns noted. Practice self-care and mindfulness. Seek help if needed.";
        } else {
            return "ðŸŒŸ You're doing well! Keep maintaining your positive habits!";
        }
    };

    return (
        <div className="result-container">
            <h2>Your Mental Health Results</h2>
            <div className="prediction-box">
                <p><strong>Stress Level:</strong> {prediction.stressScore}</p>
                <p><strong>Anxiety Level:</strong> {prediction.anxietyScore}</p>
                <p><strong>Depression Level:</strong> {prediction.depressionScore}</p>
            </div>

            <p><strong>Final Suggestion:</strong> {getFinalSuggestion()}</p>

            <p><strong>Note:</strong> If you're feeling overwhelmed, don't hesitate to reach out for support.</p>

            <button className="retake-btn" onClick={() => navigate("/questionnaire")}>
                Retake Questionnaire
            </button>
        </div>
    );
};

export default Results;
